import ReactDOM from 'react-dom';
import './index.css';
import {books} from './book';
import React from 'react';



const BookList=()=>{
    return(
        <section className='booklist'>
            {books.map((books)=>{
                return(
                    <Book {...books} key = {books.id}/>

                ) 
        })};
        </section>
    );
};


ReactDOM.render(<BookList/>, document.getElementById('root'));
